import React, { useState, useEffect } from 'react';
import AddPage from './addPage';
import DetailPage from './detailPage';

const IndexMobilPage = () => {
    const [currentView, setCurrentView] = useState('index');
    const [detailId, setDetailId] = useState(null);
    const [mobilData, setMobilData] = useState([]);

    const handleAddMobilClick = () => {
        setCurrentView('add');
    };

    const handleEditDataClick = (id) => {
        setDetailId(id);
        setCurrentView('detail');
    };

    const handleBackClick = () => {
        setCurrentView('index');
    };

    const fetchMobilData = async () => {
        try {
            const response = await fetch('http://localhost:5000/mobil/all');
            const data = await response.json();
            console.log(data);
            setMobilData(data);
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };

    useEffect(() => {
        fetchMobilData();
    }, []);

    return (
        <>
            {/* Render data mobil */}
            {mobilData.map(mobil => (
                <div key={mobil.id_mobil}>
                    <p>{mobil.nopol}</p>
                    {/* Tampilkan informasi mobil lainnya di sini */}
                </div>
            ))}

        </>
    );
};

export default IndexMobilPage;
